import Vue from "vue";
import axios from "axios";

const ajax = axios.create({
  baseURL: "http://localhost:9090/",
});
// 响应拦截器
ajax.interceptors.response.use(
  (res) => {
    console.log(res);
  },
  (err) => {
    console.log(err);
  }
);

Vue.prototype.$ajax = ajax;
